DROP TABLE IF EXISTS `football_score_t`;
CREATE TABLE `football_score_t` (
  `id` bigint(19) NOT NULL COMMENT '主键id',
  `match_id` bigint(19) NOT NULL COMMENT '比赛id',
  `team_id` bigint(19) NOT NULL COMMENT '球队id',
  `team_type` tinyint(3) NOT NULL COMMENT '1:主队1,  2:客队',
  `league_ranking` int(10) DEFAULT NULL COMMENT '联赛排名，无排名为空',
  `regular_time_score` int(10) DEFAULT NULL COMMENT '常规时间比分(含补时)',
  `half_court_score` int(10) DEFAULT NULL COMMENT '半场比分(中场前为0)',
  `score` int(10) DEFAULT NULL COMMENT '比分',
  `red_card` int(10) DEFAULT NULL COMMENT '红牌',
  `yellow_card` int(10) DEFAULT NULL COMMENT '黄牌',
  `corner_kick` int(10) DEFAULT NULL COMMENT '角球，-1表示没有角球数据',
  `overtime_score` int(10) DEFAULT NULL COMMENT '加时比分(含常规时间比分),加时赛才有',
  `point_score` int(10) DEFAULT NULL COMMENT '点球大战比分(不含常规时间比分),点球大战才有',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注信息',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `delete_flag` char(1) DEFAULT '0' COMMENT '是否删除(1.已删除0.未删除)',
  PRIMARY KEY (`id`),
  UNIQUE KEY `比赛球队主客队防重索引` (`match_id`,`team_id`,`team_type`),
  KEY `比赛关联` (`match_id`) USING BTREE,
  KEY `udfFastIdx` (`team_id`,`match_id`,`team_type`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='足球比赛得分表';

